import { useEffect , useState } from "react";
// import ContactosCard from "../../components/Contactos/ContactosCard.jsx";
import * as UserServices from "../../services/user.services";

function ListContactos({ contactos }) {
  const [users, setUsers] = useState([]);

  useEffect(() => {
      UserServices.getAllUsers(contactos)
        .then(data => {
          console.log('%cListContactos.jsx line:9 data', 'color: #007acc;', data);
          setUsers(data);
        })
        .catch(error => {
          console.log("error", error);
        });
  }, [contactos]);
  
  return (
    <>  
      {/* <ContactosCard key={contacto.friend_id} contacto={contacto} /> */}
    </>
  );

}

export default ListContactos;
